      eventDuration: 'Duration: 6 hr',
      isPrivate: false,
      eventDescription: 'SEMESTERCRAWLI anledning af sommervarmens entré i det danske land, afholder ØF for første gang en sommerfest med et særligt udgangspunkt. En konkurrence mellem semestrene uanset studie, hvor der dystes i en varieret række af konkurrencer. De ølympiske lege hvis man vil. Disse konkurrencer vil foregå sideløbende med en pubcrawl, hvor vi skal møde nogle af de bruneste barer på vesterbro og derefter en række barer på jomfru ane gade, hvortil REKOM har sponsoreret et gratis shot på Flamingoen og Guldhornene. Vi afslutter konkurrencen på Heidis, hvor det svedigste semester annonceres og får en præmie samt et bevis på, at netop jeres semester er det bedste!Vi starter turen kl. 16 på Cafe Alpha. Turen slutter kl. 21 på Heidis - hvis man ikke havde mulighed for at komme med på turen, så er man selvfølgelig også velkommen til at møde os her. Rent praktisk:Vi kommer kun til at befinde os omkring vesterbro, så der behøves ikke de vildeste vandresko.Det mest fysiske i frivilligt vil kunne deltage i er en ølstafet.Generelt skal der ikke medbringes andet end det gode humør og alle jeres studiekammerater!Der vil under turen være mulighed for at udfordre de andre semestre i jeres egne konkurrencer, hvor det kun er fantasien der sætter grænser. Det eneste krav er, at der skal være mindst en repræsentant fra hvert semester.Pointsystemet er ganske simpelt. For hver konkurrence er der;1. plads: 3 point2. plads: 2 point3. plads: 1 pointTilmelding til Semestercrawl sker ved at overføre 20 kr til MobilePay 46963 (Økonomernes Forening AAU). HUSK at skriv “Sommer”Tilmelding skal ske senest d. 26. april Vi håber på at se så mange som muligt, der selvfølgelig medbringer en kæmpe kampgejst! ',
