      eventDescription: "På dette webinar får du konkrete råd, modeller og skabeloner til at udvælge og fremhæve dine vigtigste evner i dit CV og skrive ansøgninger, der får dig til jobsamtaler – også selvom du ikke har så meget erfaring endnu.  På webinaret får du:   En simpel model, der gør det let for dig at vælge dine vigtigste erfaringer og evner ud, så du kan målrette dit CV – og gøre din ansøgning overbevisende.   Konkrete hacks til at fixe de typiske begynderfejl i CV’et og ansøgninger – så du bliver indkaldt til (flere) jobsamtaler.   Eksempler og trin-for-trin skabeloner til CV og ansøgninger, der førte til jobsamtaler – efter principperne fra dette seminar blev anvendt.  Desuden får du mulighed for Q&A med en ekspert i målrettede CV og motiverede ansøgninger. Du får links til CA's professionelle feedbackservice og skabeloner til CV og ansøgninger, der fremhæver dine mest relevante evner. Målgruppe  Webinaret er åbent for alle, der vil have konkrete metoder til CV og ansøgninger, der fører til jobsamtaler. Indholdet er særligt skræddersyet til studerende, der ønsker at arbejde i det private erhvervsliv.   Praktisk info  Webinaret afholdes online i samarbejde mellem ELSA og CA Karrierepartner og A-kasse. Dato25. april 2023Varighed  1,5 time inkl. Q&A Tilmeld dig nu  Kom med og tag det næste skridt mod dit drømmejob med et overbevisende CV og motiveret ansøgning!// ELSA Aalborg ",
